jQuery(function($) {
	$('html').removeClass('no-js').addClass('js');
	var headerHeight = $('.header').outerHeight();
	/* Slide to section */
	$('nav a').on('click', function() {
		var section = $(this).attr('href');
		if($(section).size()) {
			$('#push-menu:visible').trigger('click');
			$('html, body').animate({
				'scrollTop':  $(section).offset().top - 64
			}, 500, function() {
				//window.location.hash = section;
			});
			return false;
		}
	});
	/* Slide to section eof */

	/* Push menu */
	$('#push-menu').on('click', function() {
		$('body').toggleClass('side-menu-push-toleft');
		$('.side-menu').toggleClass('side-menu-open');
	});
	toggleRMenu();
	$(window).on('resize', function() {
		toggleRMenu();
	});
	function toggleRMenu() {
		if($(window).width() <= 959) {
			$('header nav').addClass('side-menu');
		} else {
			$('header nav').removeClass('side-menu');
			$('body').removeClass('side-menu-push-toleft');
		}
	}
	/* Push menu eof */

	/* Fixed header */
	fixedHeader();
	$(window).on('scroll resize', function() {
		if(!$('body').hasClass('fixed-header')) {
			headerHeight = $('.header').outerHeight();
		}
		fixedHeader();
	});
	function fixedHeader() {
		if($(window).scrollTop() > headerHeight) {
			$('body').addClass('fixed-header');
			$('body').css('padding-top', headerHeight + 'px');
		} else {
			$('body').removeClass('fixed-header');
			$('body').css('padding-top', '0px');
		}
	}
	/* Fixed header eof */

	/* Init fancybox */
	$(".gallery-list a").attr('rel', 'gallery_slides').fancybox({
		'cyclic' 		: true,
		'transitionIn'	: 'elastic',
		'transitionOut'	: 'elastic',
		'titleShow'		: false,
		'titlePosition' : 'over',
		'overlayColor'	: '#000',
		'overlayOpacity': 0.7
	});
	/* Init fancybox eof */
});
/* Init flexslider */
$(window).load(function() {
  	$('#homeCarousel').flexslider({
    	animation: "slide",
    	slideshow: true,
    	smoothHeight: true,
    	controlNav: false,
        animationLoop:true,
          slideshowSpeed:5000,
          animationSpeed:600

  	});
  	$('#servicesCarousel').flexslider({
    	animation: "slide",
    	slideshow: true,
    	smoothHeight: true,
    	directionNav: false
  	});
});
/* Init flexslider eof */


jQuery(function($) {
	$('#push-color-list').on('click', function() {
		$('#color-switcher').toggleClass('active');
	})
});










